  <script>
    /* 
      https://leetcode-cn.com/problems/da-yin-cong-1dao-zui-da-de-nwei-shu-lcof/
      思路：https://leetcode-cn.com/problems/da-yin-cong-1dao-zui-da-de-nwei-shu-lcof/solution/shuang-jie-fa-bif-wei-yun-suan-kuai-su-qiu-jie-jav/
    */
    function printNumbers(n) {
      let len = Math.pow(10, n) - 1
      let res = []
      for (let i = 1; i <= len; i++) {
        res.push(i)
      }
      return res
    }
  </script>
